import convertArrayToKeyedObject from './helper'

export default function team_members(state = {}, action)  {
  switch (action.type) {
    case "LIST_TEAM_MEMBERS_REQUEST":
      return Object.assign({});
    case "LIST_TEAM_MEMBERS_SUCCESS":
      return Object.assign({}, state, convertArrayToKeyedObject(action.team_members))
    default:
      return state;
  }
}


